import React from 'react';
import { Link } from 'react-router-dom';
import { easeQuadInOut } from 'd3-ease';
import AnimatedProgressProvider from './AnimatedProgressProvider';
import {
    CircularProgressbar,
    CircularProgressbarWithChildren,
    buildStyles,
} from 'react-circular-progressbar';
import 'react-circular-progressbar/dist/styles.css';
import Areas from './Areas.jsx';

const ReportScreen = () => {
    return (
        <div className="w3-container" style={{ backgroundColor: '#FFD700', width: '100%', marginBottom: '10em', padding: 0, fontSize: '1.2em' }}>
            <div className="w3-container">
                <div className="w3-margin-top w3-margin-left"><Link to="/dashboard"><i className="material-icons">arrow_back</i></Link></div>
                <div className="w3-container w3-margin-left">
                    <div style={{width: '50%'}}>
                    <AnimatedProgressProvider
                valueStart={0}
                valueEnd={83}
                duration={1.4}
                easingFunction={easeQuadInOut}
                repeat
            >
                {value => {
                    const roundedValue = Math.round(value);
                    return (
                        <CircularProgressbar
                            value={value}
                            style={{width : '100%'}}
                            text={`${roundedValue}%`}
                            /* This is important to include, because if you're fully managing the
                      animation yourself, you'll want to disable the CSS animation. */
                            styles={buildStyles({ pathTransition: 'none' })}
                        />
                    );
                }}
            </AnimatedProgressProvider>
                    </div>
                    <img src="https://www.w3schools.com/w3css/img_avatar3.png" alt="Avatar" className="w3-right w3-circle " style={{ marginTop: '-1em', width: '100px' }} />
                    <h1 style={{ margin: '0' }}>Harikrishna's</h1>
                    <h1 style={{ margin: '0' }}><b>Physical Report</b></h1>
                    <h4 style={{ marginTop: '1em', width: '80%' }}><b>Your child's physical development as per his age</b></h4>
                </div>
            </div>
            <Areas/>
            <Areas/>
            <Areas/>
            <AnimatedProgressProvider
                valueStart={0}
                valueEnd={83}
                duration={1.4}
                easingFunction={easeQuadInOut}
                repeat
            >
                {value => {
                    const roundedValue = Math.round(value);
                    return (
                        <CircularProgressbar
                            value={value}
                            style={{width : '100%'}}
                            text={`${roundedValue}%`}
                            /* This is important to include, because if you're fully managing the
                      animation yourself, you'll want to disable the CSS animation. */
                            styles={buildStyles({ pathTransition: 'none' })}
                        />
                    );
                }}
            </AnimatedProgressProvider>
        </div>
    );
}

export default ReportScreen;
